import React from 'react';
import styled from 'styled-components';

const Nav = styled.nav`
    width: 100%;
    height: 65px;
    border-bottom: 2px solid #f1f1f1;
    padding: 0 20px;
    display: flex;
    justify-content: space-between;

    .logo {
        padding: 15px 0;
    }
`

const Navbar = () => {
  return (
      <div className="navbar">
        <div classNameeeee="logo">
            Nav Bar
        </div>
        <ul>
            <li>Home</li>
            <li>About Us</li>
            <li>Contact Us</li>
            <li>Sign In</li>
            <li>Sign Up</li>
        </ul>
      </div>
  )
}

export default Navbar
